import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './LabTests.css';
import "./Header.css"

function LabTests() {
  const [labTests, setLabTests] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/api/labtests')
      .then(response => setLabTests(response.data))
      .catch(error => console.error('There was an error fetching the lab tests!', error));
  }, []);

  return (
    <div className="lab-tests">
      <h1>Popular Lab Tests & Profiles</h1>
      <div className="lab-test-list">
        {labTests.map(test => (
          <div key={test._id} className="lab-test-card">
            <h2>{test.name}</h2>
            <p>{test.description}</p>
            <p>Includes: {test.testsIncluded.join(', ')}</p>
            <p>Price: â‚¹{test.price} ({test.discount}% off)</p>
            <p>Report time: {test.reportTime}</p>
            <button>Add to Cart</button>
          </div>
        ))}
      </div>
    </div>
  );
}

export default LabTests;
